def test_get_address_txs(one_raw_block_heads, one_raw_addresses_txs, one_raw_addresses_txs_receipt,
                         one_parsed_addresses_txs):
    API.get_block_head = Mock(side_effect=one_raw_block_heads)
    API.get_address_txs = Mock(side_effect=one_raw_addresses_txs)
    API.get_address_txs_receipt = Mock(side_effect=one_raw_addresses_txs_receipt)

    OneExplorerInterface.address_txs_apis[0] = API
    expected_addresses_txs = one_parsed_addresses_txs
    for address, expected_address_txs in zip(ADDRESSES, expected_addresses_txs):
        address_txs = OneExplorerInterface.get_api().get_txs(address)
        assert len(expected_address_txs) == len(address_txs)
        for expected_address_tx, address_tx in zip(
                expected_address_txs, address_txs
        ):
            expected_address_tx, address_tx = expected_address_tx.get(
                Currencies.one
            ), address_tx.get(Currencies.one)
            assert address_tx == expected_address_tx